import React from "react";
import { Github, Linkedin, Twitter, Mail, ShieldCheck, Heart } from "lucide-react";
import { motion } from "framer-motion";

const Footer: React.FC = () => {
  const year = new Date().getFullYear();

  const socialLinks = [
    { icon: Github, url: "https://github.com/", label: "GitHub", color: "hover:bg-slate-900" },
    { icon: Linkedin, url: "https://linkedin.com/", label: "LinkedIn", color: "hover:bg-blue-700" },
    { icon: Twitter, url: "https://twitter.com/", label: "Twitter", color: "hover:bg-sky-500" },
    { icon: Mail, url: "mailto:info@collabryta.com", label: "Email", color: "hover:bg-rose-500" },
  ];

  const sections = [
    {
      title: "Product",
      links: [
        { name: "Features", url: "/features" },
        { name: "Integrations", url: "#" },
        { name: "Pricing", url: "#" },
        { name: "Changelog", url: "#" },
      ],
    },
    {
      title: "Company",
      links: [
        { name: "About Us", url: "/about" },
        { name: "Careers", url: "#" },
        { name: "Blog", url: "#" },
        { name: "Contact", url: "/support" },
      ],
    },
    {
      title: "Resources",
      links: [
        { name: "Documentation", url: "/docs" },
        { name: "Help Center", url: "/support" },
        { name: "Community", url: "#" },
        { name: "Privacy Policy", url: "#" },
      ],
    },
  ];

  return (
    <footer className="w-full bg-[#f8fafc] border-t border-slate-200 pt-20 pb-10 px-4 sm:px-10 overflow-hidden relative">
      <div className="max-w-7xl mx-auto relative z-10">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-5 gap-16 mb-20">
          {/* Logo & Brand Info */}
          <div className="lg:col-span-2 space-y-8">
            <div className="flex items-center gap-4 group cursor-pointer">
              <div className="p-3 bg-blue-600 rounded-2xl shadow-xl shadow-blue-100 transition-transform group-hover:rotate-12">
                <img src="/logo1.png" alt="Logo" className="w-8 h-8 invert brightness-0" />
              </div>
              <div>
                <h2 className="text-3xl font-bold tracking-tight text-slate-900">Collabryta</h2>
                <span className="text-[10px] font-black uppercase tracking-widest text-blue-600 mt-1 block">Unified Workspace</span>
              </div>
            </div>
            <p className="text-slate-500 text-sm leading-relaxed max-w-sm">
              Simplifying collaboration for modern engineering teams. Build better, faster, and more efficiently with our AI-integrated ecosystem.
            </p>
            <div className="flex items-center gap-4">
              {socialLinks.map(({ icon: Icon, url, label, color }) => (
                <motion.a
                  key={label}
                  href={url}
                  target="_blank"
                  rel="noopener noreferrer"
                  whileHover={{ y: -4, scale: 1.1 }}
                  className={`p-3 rounded-2xl border border-slate-200 text-slate-400 hover:text-white ${color} transition-all duration-300 shadow-sm bg-white`}
                >
                  <Icon size={20} />
                </motion.a>
              ))}
            </div>
          </div>

          {/* Nav Sections */}
          {sections.map((section) => (
            <div key={section.title} className="space-y-8">
              <h3 className="text-xs font-black uppercase tracking-[0.2em] text-slate-900">{section.title}</h3>
              <ul className="space-y-5">
                {section.links.map((link) => (
                  <li key={link.name}>
                    <a
                      href={link.url}
                      className="text-slate-500 text-sm font-medium hover:text-blue-600 hover:translate-x-2 inline-block transition-all"
                    >
                      {link.name}
                    </a>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>

        {/* Bottom Line */}
        <div className="pt-10 border-t border-slate-200 flex flex-col md:flex-row justify-between items-center gap-8 text-slate-400 font-medium">
          <div className="flex items-center gap-2 text-xs">
            <ShieldCheck size={16} className="text-emerald-500" />
            <span>Enterprise Grade Security</span>
          </div>

          <p className="text-xs">
            Â© {year} <span className="text-slate-900 font-bold tracking-tight">COLLABRYTA</span>. All rights reserved.
          </p>

          <div className="flex items-center gap-1.5 text-xs">
            <span>Built by Humans</span>
            <Heart size={14} className="text-rose-500 fill-rose-500" />
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
